import React from 'react';

const TransactionTable = ({ transactions }) => {
    return (
        <table border="1">
            <thead>
                <tr>
                    <th>Type</th>
                    <th>Currency</th>
                    <th>Amount</th>
                    <th>Price</th>
                    <th>Total</th>
                    <th>Timestamp</th>
                </tr>
            </thead>
            <tbody>
                {transactions.map(tx => (
                    <tr key={tx.id}>
                        <td>{tx.transactionType}</td>
                        <td>{tx.currency}</td>
                        <td>{tx.amount}</td>
                        <td>{tx.price}</td>
                        <td>{tx.totalCost}</td>
                        <td>{new Date(tx.timestamp).toLocaleString()}</td>
                    </tr>
                ))}
            </tbody>
        </table>
    );
};

export default TransactionTable;
